import React from 'react'

export default function DisplayWeather(props) {
    const { location, country, temp, maxTemp, main, description, icon, humidity, windSpeed, clouds, sunrise, sunset, } = props.weatherData;
    return (
        <div>
            {location} <br/>
            {country}
            {temp}
            {maxTemp}
            {main}
            {description}
            {icon}
            {humidity}
            {windSpeed}
            {clouds}
            {sunrise}
            {sunset}
        </div>
    )
}
